import re

def remove_redundant_brackets(string):
    pattern = r'\(([^(),]+)\)'  # Matches brackets with a single word (no commas)
    while re.search(pattern, string):
        string = re.sub(pattern, r'\1', string)  # Removes the brackets
    return string

